                            Owner = "Arda",
                            OwnerMail = "arda@gmail.com",
                            RecipeMaking = "Öncelikle iç pilavını hazırlamak için pilavlık pirinçler bir kaba alınır.\r\nÜzerini geçecek kadar ılık su ve tuz eklenerek 20 dakika bekletilir. Daha sonra bol su ile yıkanarak pişirme aşamasına geçilir.\r\nPilavı pişirmek için öncelikle pilav tenceresine tereyağı ve sıvı yağ alınır. Ben tereyağı ve sıvı yağı karışık kullanıyorum, çünkü hem tereyağının lezzetini seviyorum, hem de sıvı yağın parlaklık verdiğini düşünüyorum.\r\nYağlar eriyince suyu süzülen pirinçler eklenerek kavrulur.\r\n2-3 dakika kavrulduktan sonra dolmalık fıstıklar ve kuş üzümleri ilave edilir. Beraber bir iki defa karıştırılarak kavrulur.\r\nÜzerine 2 su bardağı sıcak su ilave edilir. Tuzu ayarlanır. Tencerenin kapağı kapatılarak pişmeye bırakılır.\r\nPilav suyunu çekinceye kadar pişirilir. Bu ölçüdeki pirinç için suyu bilerek az kullanıyoruz, pilavımız biraz diri kalacak.\r\nSon olarak ocaktan alınır ve tarçın ve karabiber eklenerek nazikçe karıştırılır.\r\nDiğer taraftan bütün tavuğumuz yıkanır ve varsa tüyleri ütülenir. Bu tarifte organik tavuk kullandım. Eğer bulabilirseniz köy tavuğu daha geç pişer ama daha sağlıklı ve lezzetli olacaktır, tavsiye ederim.\r\nTavuğun içi fazla bastırmadan pilavla doldurulur. Çok sıkıştırırsanız pilavınız hamur olabilir.\r\nTavuğun ayakları ya derisinden geçirilerek sıkıştırılır veya mutfak ipi ile bağlanır, böylece pişerken açılması önlenmiş olur.\r\nBir kasede sos malzemeleri karıştırılır ve fırça ile tavuğun her yerine gelecek şekilde sürülür.\r\nFırın torbasına un alınır. Poşet çevrilip sallanarak unun her yerine gelmesi sağlanır.\r\nArdından sosladığımız tavuğu poşetin içerisine dikkatli bir şekilde yerleştirelim. Garnitür olarak tavuğun yanına arpacık soğan, patates, havuç, ince kesilmiş limon dilimleri ve birkaç yaprak defne kullandım.\r\nPoşetin ağzını kapattıktan sonra bir kürdanla poşetin üzerine delikler açalım.\r\nTavuğumuzu önceden 190 dereceye ısıttığımız fırında 60 dakika boyunca pişmeye bırakalım.\r\nTencerede kalan pilava sıcak su ilave ederek pişirmeye devam edelim.  Tekrar suyunu çektiğinde üzerine bir havlu kağıt kapatarak  demlenmeye bırakılır.\r\n60 dakikanın sonunda tavuğu fırından alalım. Üzerindeki poşeti açarak fanlı ayarda 10 dakika daha pişirelim. Sürenin sonunda nar gibi kızaran nefis tavuk dolmamız servise hazır.\r\nİç pilavlı tavuk dolması nasıl servis edilir? Ben genişçe bir servis tabağının tabanına demini alan pilavı yayarak tavuk için bir yatak oluşturdum ve fırından çıkan tavuğu pilavın ortasına yerleştirdim. Pişen sebzelerimi de gelişigüzel pilavın üzerine serpiştirdim, tercih sizin, şimdiden afiyet olsun."
                        },
