                            Id = 16,
                            Owner = "Eyşan",
                            OwnerMail = "eysan@gmail.com",
                            RecipeMaking = "Taze soğan maydanoz ve taze naneyi bıçak yardımı ile iyice ince ince kıyın. Karanfil ve susamı havanda dövün. Çok kuru olmaması için içerisine 1 yemek kaşığı zeytinyağı ekleyin. İyice kıydığınız taze otları tuz, karabiber ve havanda dövdüğünüz karanfil susam karışımı ile lezzetlendirin.\r\n\r\nTemizlenmiş ve kılçıklarından arındırılmış hamsilerin birinin üzerine bu hazırladığınız harçtan sürüp diğer bir hamsiyi üzerine kapatın.\r\n\r\nTüm hamsileri bu şekilde hazırladıktan sonra mısır ununa bulayıp bir tavada kızdırdığınız sığ yağda kızartın. Dilerseniz hamsilerin içlerini boş bırakıp, sadece tuz karabiber ile tatlandırarak da kızartabilirsiniz.\r\n\r\nKızarttığınız hamsileri havlu peçete olan bir tabağa aktarın ve fazla yağından arındırıp, roka, limon ve soğan ile servis edin."
