                            Owner = "Junior",
                            OwnerMail = "junior@gmail.com",
                            RecipeMaking = "Somon için;\r\nTavanızı ocağa alın ve ekmek kırıntısını içerisine alıp rengi hafif dönene kadar kavurun.\r\nİçerisine tereyağını ilave edip eritin.\r\nArdından ince kıyılmış sarımsak ve fesleğeni ilave edip karıştırın.\r\n\r\nSomonlarınızın kenar kısmında kalan hafif yağlı kısımlarını bıçağınızla kesin.\r\nAma derisi üzerinde kalsın.\r\nBir tavayı ocağa alın ve ısıtın.\r\nİçerisine somonlarınızın derili kısımlarını yerleştirin ve hafif çıtırlaşana kadar pişirin.\r\nArdından etli kısımlarını hazırladığınız ekmek kırıntılı harca batırın.\r\nCam fırın kabınızın içerisine somonlarınızı ve kenarlarına ortadan ikiye böldüğününüz domatesleri yerleştirin.\r\n180 derecede önceden ısıtılmış fırında 20 dakika pişirin.\r\n\r\nPesto sos için;\r\nFesleğen, maydanoz, fındık, sarımsak, tuz ve karabiberi parçalayıcının içerisine alın ve iyice çekin.\r\nArdından parçalayıcının üst haznesinden toz parmesanı ekleyin ve çekin.\r\nZeytinyağını yine üst hazneden yavaş yavaş ekleyin ve her şey birbiriyle iyice karışana kadar çekmeye devam edin.\r\n\r\nBirleştirmek için;\r\nPişen somonunuzu servis edeceğiniz tabağa alın ve yanına pişirdiğiniz domatesleri ilave edin.\r\nSomonunuzun üzerine pesto sos gezdirerek servis edin."
