                            Owner = "Isaac",
                            OwnerMail = "isaac@gmail.com",
                            RecipeMaking = "Ayıklanmış hamsilerin orta kılçıklarını çıkartın.\r\nBol suda iyice yıkayıp süzgece alın ve fazla suyunun süzülmesini sağlayın.\r\n\r\nPilav için;\r\nKuş üzümünü bir kaseye alın ve üzerine sıcak su ilave edip bekletin.\r\nPilav tenceresine zeytinyağını koyun.\r\nİnce yemeklik doğranmış soğanları ilave edip yumuşayana kadar soteleyin.\r\nPirinci ilave edip kavurmaya devam edin.\r\n\r\nTuz, karabiber, kuru nane, yenibahar, suyunu süzdüğünüz kuş üzümü, toz şeker ve defne yaprağını ilave edip bir iki tur karıştırın.\r\nSuyunu ilave edin ve tencerenizin kapağını kapatıp kısık ateşte pişmeye bırakın.\r\nDereotunu ince ince kıyın ve pişen pilava ilave edip bir tur çevirin.\r\nDemlenmeye bırakın.\r\nDefne yaprağını pilavdan çıkartın.\r\n\r\n30 cm. çapında yuvarlak alüminyum kabınızı tereyağı ile yağlayın.\r\nHamsilerin derili kısımları alta gelecek şekilde sırt sırta dizin, hafif birbirlerinin üzerine gelmesine dikkat edin.\r\nKabınızın taban kısmını da hamsiyle iyice kapatın.\r\nTuz ve karabiber serpiştirin.\r\nİçine hazırladığınız pilavdan koyun ve kenarlardan sarkan hamsilerle iyice kapatın.\r\nPilavın üzerini de hamsiyle kapatın.\r\nHamsilerin üzerine tuz, karabiber serpin ve limon dilimlerini dizin.\r\n\r\nÜzerine küçük parçalar halinde tereyağı bırakın ve 180 derecede önceden ısıtılmış fırında 30 – 35 dakika üzeri kızarana kadar pişirin."
