                            OwnerMail = "kahn@gmail.com",
                            RecipeMaking = "Somon için;\r\n1 adet haşlanmış pancarı rendeleyin.\r\nSuyunu bir tülbent yardımıyla sıkın, posasını atın, suyunu karıştırma kabına ilave edin.\r\nÜzerine toz şeker ve tuzu ilave edin.\r\nLimonun kabuğunu rendeleyin.\r\nLimonun suyunu sıkın.\r\nRezenenin kök kısmını ince ince doğrayın.\r\nSomonunuzu yıkayın ve kurulayın.\r\nSomonunuzu küçük küp olacak şekilde doğrayın.\r\nSebzelerin olduğu karıştırma kasesine somonları ekleyin, karıştırın ve 15 dakika bekletin.\r\n\r\nSalata için;\r\nKinoanınızı bir sos tenceresine ekleyin ve üzerine suyunu ilave edip, kaynatın.\r\nKırmızı soğanı ince doğrayın.\r\nSalatalığın çekirdeklerini çıkartın, küçük küp doğrayın.\r\nBiberi küçük küp doğrayın.\r\nDomateslerin çekirdeklerini çıkartın ve küçük küp doğrayın.\r\nKereviz sapını ince ince doğrayın.\r\nMangonuzdan bir dilim kesin ve kabuklarını soyun.\r\nArdından küçük küp olacak şekilde doğrayın.\r\nNanelerinizi ince ince doğrayın.\r\nHepsini bir karıştırma kabına toplayın.\r\nHaşlanan kinoanızı salataya ekleyin.\r\nArdından lor peynirini de ekleyin ve karıştırın.\r\n\r\nSos için;\r\nBir karıştırma kabına toz şeker ve limon suyunu çırpın.\r\nŞeker hafif eriyince zeytinyağını ekleyerek çırpmaya devam edin.\r\n\r\nAvokado için;\r\nAvokadonuzun kabuğunu soyun.\r\nKüçük küpler halinde doğrayın.\r\nHazırladığınız sostan 2 yemek kaşığı avokadonuzun üzerine gezdirin."
