                            Owner = "Lionel",
                            OwnerMail = "lionel@gmail.com",
                            RecipeMaking = "Karidesleri, ince bir fileto ya da carving bıçağı ile karın kısımlarındaki zarı , içindeki etli bölümü zedelemeden keserek işe başlayın. Kuyruga kadar itina ile zarı kestiginize emin olun Daha sonra işaret parmagınız ile kafasının arkasındaki kabugun kafaya birleşme yerinden , dış kabugu çıtlatın. Parmağınız ile bütün sırtındaki kabuk boyunca , kuyruguna kadar kabugu zedelemeden aşağı kadar inerek kabugu koparmadan etli yuzeyden ayırın. Aynı fileto ya da carving bıçağı ile karidesleri sırt kısmına kafadan başlayıp kuyruga kadar bir derin çizik atın. Karidesin iç organları ve pisligi bu kısımda bulunur ve bu kısmın mutlaka cıkartılması gerekir. Bu kısmı çıkarttıktan sonra kafa kısmındaki diger organlarını da bir çay kaşığı ile temizleyin Bütün karidesi yıkayın ve tekrar kabuğunu etli kısmın üstüne kapatın Bir tavaya kaya tuzunu bir kat olarak serin ve altını harlı ateşte ısıtmaya başlayın. Tuz ısınınca karidesleri (kabukları üzerinde olacak) tuzun üstüne yerleştirin her iki tarafını da cevirerek, 5-6 dakika kadar pişirin İstediğiniz bahçe yeşillikleri üzerinde kabuğu ile servis edin."
