                            Id = 21,
                            Owner = "Staphen",
                            OwnerMail = "staphen@gmail.com",
                            RecipeMaking = "Asma yapraklarını salamura kullanıyorsanız, sadece sıcak suda bekletip tuzunu alın.\r\nTaze asma yaprağı kullanıyorsanız, suda yıkayıp haşlayın.\r\n\r\nPilav için;\r\nPirinci nişastası çıkıncaya kadar yıkayıp süzün.\r\nGeniş bir tencereyi ocağa alın, içerisine zeytinyağını alın ve kızdırın.\r\nDolmalık fıstığı, tencereye ekleyip hafif renk alana kadar kavurun, soğanı ilave ederek kavurmaya devam edin.\r\nSoğanlar yumuşayınca yıkanmış pirinci ekleyin, şeffaflaşana kadar kavurmaya devam edin.\r\nTuz, karabiber, tarçın, yenibahar ve kuru naneyi ekleyip karıştırın.\r\nPirincin üzerine 1 su bardağı vişne suyu, 1 su bardağı su, 1 yemek kaşığı nar ekşisi, 1 yemek kaşığı toz şeker ve kuş üzümünü ekleyin, bir tur karıştırın.\r\n\r\nPilavın suyu kaynadıktan 5 dakika sonra ocaktan alın ve soğumaya bırakın.\r\n\r\nSarmak için;\r\nTencerenin dibine asma yapraklarından bir taban yapın.\r\nAsma yapraklarına uygun miktarda harç ve birer adet vişne koyup, kenarlarını ortaya katlayarak parmak kalınlığında sarın.\r\nHazırladığınız sarmaları, asma yapraklarının üzerine dizin.\r\nKalan vişneleri aralarına serpiştirin.\r\nÜzerine 1 – 1,5 su bardağı su, vişne suyu ve 4 – 5 yemek kaşığı zeytinyağı ekleyin.\r\nÜzerlerine porselen bir tabak koyup tencerenin kapağını kapatın.\r\nÇok kısık ateşte yaklaşık 35 – 40 dakika pişirin.\r\n\r\nKendi tenceresinde oda sıcaklığına gelmesini bekleyin.\r\nIlık ya da soğuk servis edin."
