                            Owner = "Leo",
                            OwnerMail = "leo@gmail.com",
                            RecipeMaking = "Bir karıştırma kabına su ve un ilave edip ayıkladığınız baklaları içerisine alın.\r\nDiğer malzemeler hazırlanana kadar bekletin.\r\nTencerenizi ocağa alın ve ısıtın.\r\nIsınan tencerenin içerisine zeytinyağı ince yemeklik doğradığınız soğanları ilave edip yumuşayana kadar kavurun.\r\nKavrulan soğanın içerisine suda beklettiğiniz baklaları ilave edin.\r\nTuz, karabiber, toz şeker ve un serpip karıştırın.\r\nArdından suyunu ilave edin ve orta ateşte 20 dakika pişirin.\r\nPişen baklanızı ocaktan alın ve tencerede soğumaya bırakın.\r\nSoğuyan baklanızı servis tabağına alın ve üzerine ince doğradığınız dereotu serpin.\r\nYanına yoğurtla servis edin."
