                            Id = 24,
                            Owner = "Mahi",
                            OwnerMail = "mahi@gmail.com",
                            RecipeMaking = "Baklayı 1 gece önceden soğuk suda ıslatın.\r\nSoğanı iri iri doğrayın. Bir tencereye zeytinyağını ekle ve ısınınca soğanları ekleyip biraz kavurun, ardından bakla, şeker, tuz, dereotunun yarısı, üzerini 4 parmak geçecek kadar su koyarak tüm malzemeler iyice yumuşayıncaya ve içerisinde hiç sıvı kalmayıncaya kadar pişirin.\r\nFavanın çok sulu olmaması için suyunu çekmesi gerekir. Tenceredeki malzeme lapa kıvamında olmalıdır. Hazır hale geldiğinde el mikseriyle bütün malzemeyi çekin ve soğuması için kenara alın.\r\n\r\nEnginar için;\r\n\r\nSoğanı yemeklik doğrayın. Tencereye zeytinyağını ilave edin ısınınca soğanları ekleyin ve kavurun.\r\nSoğanlar yumuşayınca enginarları ekleyin. Bir portakalın suyunu ve içindeki parçacıklarını ekleyin. Tuz, şeker ve su ekleyip kapağını kapatın. Enginarlar pişince tencereyi kenara alın.\r\n\r\nEnginarlar soğuyunca içlerine fava doldun. Enginarın içinde piştiği portakallı sostan üzerlerine gezdirin ve dereotu yaprakları serperek servis edin."
