                            Owner = "Sevinç",
                            OwnerMail = "sevinc@gmail.com",
                            RecipeMaking = "Patlıcanlar için;\r\nPatlıcanlarınızın baş ve uç kısımlarını kesin.\r\nOrtadan ikiye bölün ve kızgın zeytinyağında patlıcanları bütün olarak önlü arkalı yumuşayıncaya kadar kızartın.\r\nHepsini kızarttıktan sonra kağıt havlunun üzerine alın.\r\n\r\nİç harcı için;\r\nSoğanları piyazlık doğrayın.\r\nSarımsakları boyundan ikiye bölün.\r\nBiberleri ince doğrayın.\r\nTavanızı ocağa alın, zeytinyağını ekleyip ısıtın.\r\nIsınan yağınızın içerisine soğanınızı ekleyin ve hafif yumuşayana kadar soteleyin.\r\nSotelenen soğanınızın içerisine sarımsak, biber ve sebzelerinizin kolay sotelenmesi için birazcık tuz ekleyip sotelemeye devam edin.\r\nDomateslerinizin kabuklarını soyun.\r\nDomateslerinizin çekirdeklerini çıkartın ve küçük küpler halinde doğrayın.\r\nSoğanlarınıza tuz ve karabiberi ekleyip karıştırın.\r\nDomatesi ekleyin ve sotelemeye devam edin.\r\nToz şekeri içerisine ekleyin ve karıştırın.\r\nMaydanozu ince ince doğrayın ve sotelenen sebzelerinizin içerisine alıp ocaktan alın.\r\n\r\nBirleştirmek için;\r\nPatlıcanları tencereye dizin.\r\nOrtalarını, bıçak yardımıyla çizgi şeklinde açın, kaşıkla genişletin, tabana kadar inmemeye özen gösterin.\r\nİçlerine biraz toz şeker, tuz ve karabiber serpip hazırladığınız harçtan doldurun.\r\nTavada kalan domatesli suyu (domatesin suyu kalmadıysa 2-3 yemek kaşığı suyu) tencerenin üzerine dökün.\r\nÜzerine zeytinyağı ve su gezdirin.\r\nKapağı kapalı olarak 20 – 25 dakika pişirin.\r\n\r\nNot: Eğer kızartma yapmak istemezseniz, her şeyi çiğ olarak, aynı metotla, pişirme süresini 1 saat civarında arttırarak yapabilirsiniz."
